import React, { useState } from'react';
import './App.css';
import Form from './Components/Form';
import SkillsList from './Components/SkillsList';
import axios from 'axios';


function App() {
  // State stuff
  const [inputText, setInputText] = useState("");
  const [skills, setSkills] = useState([]);
  const [logins, setLogins] = useState({});

  // Functions
  function updateLogins(e) {
    setLogins({...logins, [e.target.name]:e.target.value})
  }
// Add error handling for when the post req fails
  const submitHandler = (e) => {
    e.preventDefault();

    const userObject = {
      userName : logins.username,
      userPassword: logins.password
    };
    axios.post('/add-userasdas', userObject)
      .then((res) => {
        console.log(res.data)
      }).catch((error) => {
        console.log(error)
      });
      setLogins({});
  }
  // function submitHandler() {
  //   console.log(logins)
  //   axios({
  //     method: 'post',
  //     url: 'http://localhost:3001/add-user',
  //     data: logins
  //   })
  //   .then( (res) => {
  //     console.log(res)
  //   })
  // }
  // fetch("http://localhost:3001/add-user")
  //   .then((response) => {console.log(response)})


  return (
    <div className="App">
      <nav>
          <input onChange={updateLogins} name="username" placeholder="User Name">
          </input>
          <input onChange={updateLogins} name="password" placeholder="Password">
          </input>
          <button onClick={submitHandler}>Login</button>
        </nav>
      <div className='app-container'>
        <h1 className='app-name'>Level Up App</h1>
        <Form 
          inputText={inputText}
          setInputText={setInputText}
          skills={skills}
          setSkills={setSkills}
        />

        <SkillsList
          skills={skills}
          setSkills={setSkills}
        />
      </div>

    </div>
  );
}

export default App;
